import React from "react";

class MovieCard extends React.Component{
    render(){
        return (
            <div className="main">
                <div className="movie-card">
                    <div className="left">
                        <img alt="poster" />
                    </div>
                    <div className="right">
                        <div className="title">The Avengers</div>
                        <div className="plot">SuperNatural powers </div>
                        <div className="price">10,000</div>
                        <div className="footer">
                            <div className="rating">8.5</div>
                            <div className="stars">star</div>
                            <button className="favourite-btn">FFavourite</button>
                            <button className="cart-btn">Add to car</button>
                        </div>
                    </div>

                </div>
            </div>
        )       
    }
}
export default MovieCard;
